                              <h3 style="text-align:center;margin-bottom:0px;margin-top:10px;">Coordenadora - Drª Inês Santos</h3>
                            </div>
                            <div class="cell medium-6 large-6">
                                <p>Acreditamos que a maternidade e a paternidade são experiências que devem ser vividas de forma instintiva, dentro do estilo parental de cada família e em pleno equilíbrio com as suas expectativas e sonhos.</p>
                                <p>O Centro do Bebé nasceu em Lisboa, em Março de 2014, como resultado de vários anos no acompanhamento e apoio à parentalidade. Em Setembro de 2018, o modelo expandiu-se à Região Centro do país, integrando a abordagem inovadora e pioneira do Centro do Bebé com a articulação direta da vigilância da saúde pediátrica.</p>
                                <p>Numa perspectiva de grande respeito pelo bebé e pelas opções parentais, <b>ajudamos a minimizar as dificuldades dos pais e a potenciar a compreensão dos seus bebés, sem métodos intrusivos ou que passem pelo conflito entre pais e bebés.</b></p>
                                <p><a style="color:#015580;font-size:20px;text-decoration:underline;" target="_blank" href="https://centrodobebe.pt/centro-do-bebe-viseu">Centro do Bebé - Viseu</a></p>
